ARTICIPANT;PARTSTAT=DECLINED;\r\n CN=clare.jolly@digivizer.com;X-NUM-GUESTS=0:mailto:\r\n clare.jolly@digivizer.com\r\nATTENDEE;CUTYPE=INDIVIDUAL;ROLE=REQ-PARTICIPANT;PARTSTAT=NEEDS-ACTION;\r\n CN=jacquelyn.cowardin@digivizer.com;X-NUM-GUESTS=0:mailto:\r\n jacquelyn.cowardin@digivizer.com\r\nATTENDEE;CUTYPE=INDIVIDUAL;ROLE=REQ-PARTICIPANT;PARTSTAT=DECLINED;\r\n CN=alan.smith@digivizer.com;X-NUM-GUESTS=0:mailto:\r\n alan.smith@digivizer.com\r\nATTENDEE;CUTYPE=INDIVIDUAL;ROLE=REQ-PARTICIPANT;PARTSTAT=NEEDS-ACTION;\r\n CN=madi.mooney@digivizer.com;X-NUM-GUESTS=0:mailto:\r\n madi.mooney@digivizer.com\r\nX-GOOGLE-CONFERENCE:https://meet.google.com/wyq-dqvg-rjz\r\nCREATED:20230223T045035Z\r\nDESCRIPTION:Hi everyone. <br><br>I think the only clash I saw here was a \r\n lunch time block\\, which I respectfully seek to \r\n overturn.<br><br>Realistically this is the first slot that we might all \r\n make.<br><br>Emma's absence is deliberate. We are now aware of the \r\n requirement to act\\, so we can hook back to the year's original plan and \r\n priorities. That will make her comfortable.<br><br>If a couple of us \r\n don't need to be on this (Rob?) let us know. I'm including everyone as \r\n the default.<br><br>The objectives and agenda are:<br><ol><li>Fill the \r\n gap between now and the announcement of LI to add to our own \r\n funnel.<br></li><li>Focus first of all is on launching or otherwise \r\n re-energizing Free.</li><li>We will<ol><li>Agree on \r\n messages</li><li>Agree on the CTA we seek to offer</li><li>Scope and \r\n agree on assets we need to create. Tap into what we have\\, create new \r\n asset 'front-ends'</li><li>Self-approve all of the above</li><li>Assign \r\n resources</li><li>Prepare the brief for those resources\\, tell them \r\n Friday afternoon that its' coming\\, deliver to them noon on Monday \r\n latest</li><li>Aim to go live Wednesday 8 March - WHILE WE ARE IN OUR \r\n 1-DAY PLANNING MEETING. This deliberately creates productive creative \r\n friction for the team tasked with executing this program\\, and gives \r\n them/us 2 days to create and load assets. If this really is pushing the \r\n envelope too hard\\, let's default to Thursday - but not to allow us to \r\n approve\\, but allow another 24 hours on creative. How hard and fast dare \r\n we go?<br></li><li>This timetable gives us time to measure\\, assess and \r\n recalibrate over the ensuing 2-3 weeks\\, to refine the program based on \r\n our own data. That helps create the notional 2-3 week program rhythm\\, \r\n and synchs with the expected LI approvals\\, that then slipstream behind \r\n this earlier program. This also forces us to create a program that starts \r\n to deliver: we are naturally constrained by time limits\\, which will \r\n productively force us to make choices designed to engender action. Phases \r\n 2 onwards can be scoped next\\, alongside LI \r\n and...</li></ol></li><li>Consider and agree on the next program (take \r\n this from the original\\, January plan)</li></ol><br>Thank you. We tell \r\n Emma what we're doing\\, but that's it. <br><br>Alan.\\n\\n-::~:~::~:~:~:~:\r\n ~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~::~:~::\r\n -\\nJoin with Google Meet: https://meet.google.com/wyq-dqvg-rjz\\nOr dial: \r\n (AU) +61 2 9051 7453 PIN: 647279851#\\nMore phone numbers: https:\r\n //tel.meet/wyq-dqvg-rjz?pin=7949291266316&hs=7\\n\\nLearn more about Meet \r\n at: https://support.google.com/a/users/answer/9282720\\n\\nPlease do not \r\n edit this section.\\n-::~:~::~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:~:\r\n ~:~:~:~:~:~:~:~:~:~:~:~:~::~:~::-\r\nLAST-MODIFIED:20230303T010045Z\r\nLOCATION:Either Google or in The Porter\r\nSEQUENCE:2\r\nSTATUS:CONFIRMED\r\nSUMMARY:Planning to launch Free and one other Digivizer initiative\\, \r\n ahead of LI\r\nTRANSP:TRANSPARENT\r\nX-EVOLUTION-CALDAV-ETAG:63813488445\r\nBEGIN:VALARM\r\nACTION:DISPLAY\r\nDESCRIPTION:This is an event reminder\r\nTRIGGER:-PT10M\r\nX-EVOLUTION